import CartWidget from "../CartWidget/CartWidget";

const NavBar = () => {
  return (
    <header>
      <nav>
        <h3>My e-commerce Wine</h3>
        <ul>
          <li>
            <a href="#">Quienes Somos</a>
            <a href="#">Tienda </a>
            <a href="#">Ofertas</a>
            <a href="#">Contacto</a>
            <a href="#">Salir</a>
          </li>
        </ul>
      </nav>
      <CartWidget/>
    </header>
  );
};

export default NavBar;
